playstore_details.description:
Software introduction:
Application can use BLE to transmit data with electronic nutrition scale, is a healthy diet life good helper. The user can be relaxed to make the individual diet and health management whenever and wherever possible.
The main function of:
1) software for data transmission via BLE and BLE electronic nutrition scale;
2) automatic transmission, save the dietary data;
3) automatically determine whether the health of individual diet;
4) automatically generate curve graph of human health diet data;
